// src/App.js
import React from 'react';
import DigitalCard from './DigitalCard';

function App() {
  const companyInfo = {
    companyName: "Osttra",
    contact: {
      email: "info@osttra.com",
      phone: "+1234567890",
      address: "123 Business Rd, City"
    },
    products: ["Product A", "Product B", "Product C"],
    whatsappNumber: "1234567890" // without "+" sign
  };

  return (
    <div className="App">
      <DigitalCard
        companyName={companyInfo.companyName}
        contact={companyInfo.contact}
        products={companyInfo.products}
        whatsappNumber={companyInfo.whatsappNumber}
      />
    </div>
  );
}

export default App;
